\begin{align*}
\int_2^e \frac{\log^2 x - 1}{x \log^2 x} \, dx &= \int_2^e \frac{1}{x} \, d(\log x) - \int_2^e \frac{1}{x \log^2 x} \, dx \\
&= \left[\log\log x\right]_2^e - \left[-\frac{1}{\log x}\right]_2^e \\
&= \log\log e - \log\log 2 + \frac{1}{\log 2} - \frac{1}{\log e}
\end{align*}

